import React, { useState, useEffect, useRef } from "react";
import { Modal } from "bootstrap";
import './Dashboard.css';


function PopForm() {
    const [modal, setModal] = useState(null);
    const exampleModal = useRef();

    useEffect(() => {
        setModal(new Modal(exampleModal.current))
    }, []);

    const [recName, setRecName] = useState('');
    const [phoneNumber, setPhoneNumber] = useState('');
    // const [dateTime, setDateTime] = useState('');
    const [shippingCompany, setShippingCompany] = useState('');
    const [ShippmentNumber, setShippmentNumber] = useState('');

    console.log(recName, phoneNumber, ShippmentNumber);

    return (
        <>
            <button
                type="button"
                className="btn btn-primary"
                onClick={() => modal.show()} >Add</button>
            <div className="modal modal-lg fade" id="exampleModal" ref={exampleModal} tabindex="-1" aria-labelledby="exampleModalLabel" aria-hidden="true">
                <div className="modal-dialog">
                    <div className="modal-content">
                        <div className="modal-header">
                            <h1 className="modal-title fs-5" id="exampleModalLabel">New Shipping</h1>
                            <button type="button" className="btn-close" data-bs-dismiss="modal" aria-label="Close"></button>
                        </div>
                        <form>
                            <div className="modal-body">

                                <div className="row">
                                    <div className="col-md-6">
                                        <label className="form-label">Name</label>
                                        <input type="text" className="form-control"
                                            placeholder="Abdullah"
                                            required value={recName}
                                            onChange={(e) => setRecName(e.target.value)} />
                                    </div>
                                    <div class="col-md-6">
                                        <label for="exampleFormControlInput1" className="form-label">Phone Number</label>
                                        <input type="number" className="form-control"
                                            id="exampleFormControlInput1" placeholder="0576717982"
                                            maxLength='10' required /> value={phoneNumber}
                                        onChange={(e) => setPhoneNumber(e.target.value)}
                                    </div>
                                </div>
                                <div className="row">
                                    <div className="col-md-6">
                                        <label for="exampleFormControlInput1" className="form-label">Shipping Company</label>
                                        <select className="form-select" aria-label="Default select example">
                                            <option selected>Open this select menu</option>
                                            <option value="1">One</option>
                                            <option value="2">Two</option>
                                            <option value="3">Three</option>
                                        </select>
                                    </div>
                                    <div className="col-md-6">
                                        <label for="exampleFormControlInput1" className="form-label">Scan Number</label>
                                        <input type="number" className="form-control is-valid"
                                            id="exampleFormControlInput22" placeholder="1256166512315"
                                            required value={ShippmentNumber}
                                            onChange={(e) => setShippmentNumber(e.target.value)} />
                                    </div>
                                </div>


                            </div>
                            <div className="modal-footer">
                                <button type="button" className="btn btn-secondary" data-bs-dismiss="modal">Close</button>
                                <button type="submit" className="btn btn-primary" onClick={setLocalStorage()}>Send message</button>
                            </div>
                        </form>
                    </div>
                </div>
            </div>
        </>
    )
}

// function checkLocalStorage() {
    
// }

function setLocalStorage() {
    localStorage.setItem('RecipientName', recName);
    localStorage.setItem('PhoneNumber', phoneNumber);
    localStorage.setItem('DateTime', 'DateTime');
    localStorage.setItem('ShippingCompany', 'ShippingCompany');
    localStorage.setItem('ShippmentNumber', ShippmentNumber);
}

export default PopForm;
